// MenuList.js
import React from 'react';
import MenuItem from './MenuItem'; // Import MenuItem component

const MenuList = ({ items }) => (
  <section>
    {items.map((item) => (
      <MenuItem key={item.id} {...item} />
    ))}
  </section>
);

export default MenuList;
